<div id="page-container">
<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w2 h0"><div class="t m0 x1 h2 y2 ff1 fs0 fc0 sc0 ls1 ws1">POLÍTICA DE PRIV<span class="_ _0"></span>A<span class="_ _1"></span>CID<span class="_ _1"></span>AD<span class="ff2"> </span></div><div class="t m0 x1 h3 y3 ff3 fs1 fc1 sc0 ls1 ws1">Esta política de privacidad establece la forma en que <span class="_ _1"></span>se van a gestionar los datos </div><div class="t m0 x1 h3 y4 ff3 fs1 fc1 sc0 ls1 ws1">personales en esta web. Es impres<span class="_ _1"></span>cindible que la leas y aceptes antes de seguir </div><div class="t m0 x1 h3 y5 ff3 fs1 fc1 sc0 ls1 ws1">navegando. </div><div class="t m0 x1 h3 y6 ff3 fs1 fc1 sc0 ls1 ws1">En esta declaración de privacidad se <span class="_ _1"></span>explica qué datos <span class="_ _2"></span>personales recopilamos de </div><div class="t m0 x1 h3 y7 ff3 fs1 fc1 sc0 ls1 ws1">nuestros usuarios y cómo los utilizamos. </div><div class="t m0 x1 h3 y8 ff3 fs1 fc1 sc0 ls1 ws1">Lee detenidamente nuestra política de privacidad antes de facili<span class="_ _1"></span>tar tus datos.<span class="_ _2"></span> </div><div class="t m0 x1 h3 y9 ff3 fs1 fc1 sc0 ls1 ws1">Esta web respeta y cuida los datos personales de sus usuarios. Como usuario debes </div><div class="t m0 x1 h3 ya ff3 fs1 fc1 sc0 ls1 ws1">saber que tus derechos están garantizados. </div><div class="t m0 x2 h3 yb ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Nunca solicitamos información personal a menos que realmente <span class="_ _1"></span>sea </span></span></div><div class="t m0 x3 h3 yc ff3 fs1 fc1 sc0 ls1 ws1">necesaria para prestarte los se<span class="_ _1"></span>rvicios que nos requieras.<span class="_ _2"></span> </div><div class="t m0 x2 h3 yd ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Nunca compartimos información personal de nuestros us<span class="_ _1"></span>uarios con nadie, </span></span></div><div class="t m0 x3 h3 ye ff3 fs1 fc1 sc0 ls1 ws1">excepto para cumplir con la ley o en caso <span class="_ _1"></span>que c<span class="_ _2"></span>ontemos con tu autorización </div><div class="t m0 x3 h3 yf ff3 fs1 fc1 sc0 ls1 ws1">expresa. </div><div class="t m0 x2 h3 y10 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Nunca utilizaremos tus datos personales <span class="_ _1"></span>con una finalidad diferente a la </span></span></div><div class="t m0 x3 h3 y11 ff3 fs1 fc1 sc0 ls1 ws1">expresada en esta política de <span class="_ _1"></span>privacidad.<span class="_ _2"></span> </div><div class="t m0 x1 h4 y12 ff2 fs3 fc0 sc0 ls1 ws1">Responsable del tratamiento de tus datos personales </div><div class="t m0 x1 h3 y13 ff3 fs1 fc1 sc0 ls1 ws1">A efectos de lo previsto en el <span class="_ _1"></span>Reglamento General de Pro<span class="_ _2"></span>tección de Datos antes citado, </div><div class="t m0 x1 h3 y14 ff3 fs1 fc1 sc0 ls1 ws1">los datos personales que nos envíes<span class="_ _1"></span> a través de los formularios de la web, recibirán el </div><div class="t m0 x1 h3 y15 ff3 fs1 fc1 sc0 ls1 ws1">tratamiento de datos de &quot;Usuarios de la web y s<span class="_ _1"></span>uscriptores&quot;.<span class="_ _2"></span> </div><div class="t m0 x1 h3 y16 ff3 fs1 fc1 sc0 ls1 ws1">Para el tratamiento de datos de nuestros usuarios, im<span class="_ _1"></span>plementamos todas l<span class="_ _2"></span>as medidas </div><div class="t m0 x1 h3 y17 ff3 fs1 fc1 sc0 ls1 ws1">técnicas y organizativas de seguridad es<span class="_ _1"></span>table<span class="_ _2"></span>cidas en la legislación vigente. </div><div class="t m0 x1 h4 y18 ff2 fs3 fc0 sc0 ls1 ws1">¿Cómo hemos obtenido tus datos? </div><div class="t m0 x1 h3 y19 ff3 fs1 fc1 sc0 ls1 ws1">Los datos personales que tratamos en Salud Integral proceden de: </div><div class="t m0 x2 h3 y1a ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Formulario de contacto. </span></span></div><div class="t m0 x2 h3 y1b ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Formulario de subscripción. </span></span></div><div class="t m0 x2 h3 y1c ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Comentarios en blog. </span></span></div><div class="t m0 x2 h3 y1d ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Formulario de registro de usuario. </span></span></div><div class="t m0 x2 h3 y1e ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Datos de usuario. </span></span></div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w2 h0"><div class="t m0 x2 h3 y1f ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Entrevista y tratamiento Psicológico. </span></span></div><div class="t m0 x1 h4 y20 ff2 fs3 fc0 sc0 ls1 ws1">¿Con qué finalidad tratamos tus datos personales? </div><div class="t m0 x1 h3 y21 ff3 fs1 fc1 sc0 ls1 ws1">Cuando un usuario se conecta con esta w<span class="_ _1"></span>eb, facilita información de carácter personal </div><div class="t m0 x1 h3 y22 ff3 fs1 fc1 sc0 ls1 ws1">entre las que podemos encontrar, su nombre, correo electrónico, IP, teléfono de </div><div class="t m0 x1 h3 y23 ff3 fs1 fc1 sc0 ls1 ws1">contacto entre otros. Al fac<span class="_ _1"></span>ilitar esta información, el usuario da su consentimiento, para </div><div class="t m0 x1 h3 y24 ff3 fs1 fc1 sc0 ls1 ws1">recopilar, gestionar, utilizar y <span class="_ _1"></span>almacenar a, en las condiciones que describe el<span class="_ _2"></span> aviso legal </div><div class="t m0 x1 h3 y25 ff3 fs1 fc1 sc0 ls1 ws1">y esta política de privacidad. </div><div class="t m0 x1 h3 y26 ff3 fs1 fc1 sc0 ls1 ws1">En Psicoglobal.com existen diferentes sistem<span class="_ _1"></span>as de captura de información personal y </div><div class="t m0 x1 h3 y27 ff3 fs1 fc1 sc0 ls1 ws1">trato la información que nos facilitan las <span class="_ _1"></span>perso<span class="_ _2"></span>nas interesadas con el siguie<span class="_ _1"></span>nte fin por </div><div class="t m0 x1 h3 y28 ff3 fs1 fc1 sc0 ls1 ws1">cada sistema de captura: </div><div class="t m0 x1 h5 y29 ff2 fs1 fc0 sc0 ls1 ws1">Formulario de contacto<span class="ff3 fc1">: Aquí te solicitamos tu nombre y E-Mail. Te pedimos estos </span></div><div class="t m0 x1 h3 y2a ff3 fs1 fc1 sc0 ls1 ws1">datos para poder contestarte a las dudas, preguntas, comentarios o s<span class="_ _1"></span>olicitudes de </div><div class="t m0 x1 h3 y2b ff3 fs1 fc1 sc0 ls1 ws1">información que hagas a través <span class="_ _1"></span>de dicho formulario<span class="_ _2"></span>.  </div><div class="t m0 x1 h5 y2c ff2 fs1 fc0 sc0 ls1 ws1">Formulario de suscripción al blog<span class="ff3 fc1">: Aquí los datos que te solicitamos es tu nombre y </span></div><div class="t m0 x1 h3 y2d ff3 fs1 fc1 sc0 ls1 ws1">dirección de correo electrónico. Te pedimos <span class="_ _1"></span>este dato para poder enviarte los boletines </div><div class="t m0 x1 h3 y2e ff3 fs1 fc1 sc0 ls1 ws1">con los nuevos artículos que publiquemos en la We<span class="_ _1"></span>b<span class="_ _2"></span><span class="ls2">. </span>Puedes consultar su <span class="fc2">aviso legal y </span></div><div class="t m0 x1 h3 y2f ff3 fs1 fc2 sc0 ls1 ws1">política de privacidad<span class="fc1">. </span></div><div class="t m0 x1 h5 y30 ff2 fs1 fc0 sc0 ls1 ws1">Formulario de envío de comentarios del blog<span class="ff3 fc1">: Para comentar las publicaciones del </span></div><div class="t m0 x1 h3 y31 ff3 fs1 fc1 sc0 ls1 ws1">blog de Salud Integral se requiere el nombre, correo electrónico y opcionalmente un </div><div class="t m0 x1 h3 y32 ff3 fs1 fc1 sc0 ls1 ws1">sitio web. Estos datos posibilitan al usuario realizar tantos comentarios como desee y </div><div class="t m0 x1 h3 y33 ff3 fs1 fc1 sc0 ls1 ws1">dar respuesta sobre los anteriores. </div><div class="t m0 x1 h5 y34 ff2 fs1 fc0 sc0 ls1 ws1">Formulario de registro de usuario<span class="ff3 fc1">: Aquí te solicitamos tu nombre y correo electrónico, </span></div><div class="t m0 x1 h3 y35 ff3 fs1 fc1 sc0 ls1 ws1">que necesitamos para poder crear tu área de usuario privada y que <span class="_ _1"></span>puedas acceder a </div><div class="t m0 x1 h3 y36 ff3 fs1 fc1 sc0 ls1 ws1">ella así como a todas sus funcionalidades: compra y reserva de servicios, documentación </div><div class="t m0 x1 h3 y37 ff3 fs1 fc1 sc0 ls1 ws1">de la terapia y mensajería interna con el/especialista. Al mismo tiempo estos datos serán </div><div class="t m0 x1 h3 y38 ff3 fs1 fc1 sc0 ls1 ws1">utilizados para comunicaciones automáticas via E-Mail de las acciones realizadas, como </div><div class="t m0 x1 h3 y39 ff3 fs1 fc1 sc0 ls1 ws1">por ejemplo: alta como usuario de la plataforma, compra de cupones y bonos, reserva </div><div class="t m0 x1 h3 y3a ff3 fs1 fc1 sc0 ls1 ws1">de servicios, alertas de nuevo mensaje interno, etc.  </div><div class="t m0 x1 h5 y3b ff2 fs1 fc0 sc0 ls1 ws1">Datos de usuario<span class="ff3 fc1">: Aquí te solicitamos un teléfono de contacto, una cuenta de <span class="_ _1"></span>Skype, </span></div><div class="t m0 x1 h3 y3c ff3 fs1 fc1 sc0 ls1 ws1">yahoo o Gtalk. El teléfono te lo requerimos para ponernos en contacto contigo si fuera </div><div class="t m0 x1 h3 y3d ff3 fs1 fc1 sc0 ls1 ws1">necesario para avisarte de cambios en las sesiones o avisos <span class="_ _1"></span>urgentes, siempre y cuando </div><div class="t m0 x1 h3 y3e ff3 fs1 fc1 sc0 ls1 ws1">no se haya podido hacer esta comunicación por mensajería interna.  </div></div><a class="l" href="https://mailrelay.com/es/aviso-legal"><div class="d m1" style="border-style:none;position:absolute;left:463.190000px;bottom:401.030000px;width:79.060000px;height:15.970000px;background-color:rgba(255,255,255,0.000001);"></div></a><a class="l" href="https://mailrelay.com/es/aviso-legal"><div class="d m1" style="border-style:none;position:absolute;left:69.750000px;bottom:373.070000px;width:117.610000px;height:27.960000px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf3" class="pf w0 h0" data-page-no="3"><div class="pc pc3 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w2 h0"><div class="t m0 x1 h5 y1f ff2 fs1 fc0 sc0 ls1 ws1">Datos de entrevista y tratamiento psicológico<span class="ff3 fc1">: Aquí los datos que se te piden son </span></div><div class="t m0 x1 h3 y3f ff3 fs1 fc1 sc0 ls1 ws1">datos relativos a la salud, tanto psicológica como física. <span class="_ _1"></span>Estos datos son recabados por </div><div class="t m0 x1 h3 y40 ff3 fs1 fc1 sc0 ls1 ws1">medio oral o escrito, por cuestionarios y tes<span class="_ _1"></span>t psicológicos. Estos datos los necesitamos </div><div class="t m0 x1 h3 y41 ff3 fs1 fc1 sc0 ls1 ws1">para poder diseñar la terapia y <span class="_ _1"></span>el tratamiento necesario para gestionar las causas por las </div><div class="t m0 x1 h3 y42 ff3 fs1 fc1 sc0 ls1 ws1">que contratas el servicio de psicología. De la misma manera <span class="_ _1"></span>que para verificar el optimo </div><div class="t m0 x1 h3 y43 ff3 fs1 fc1 sc0 ls1 ws1">desarrollo de la misma.  </div><div class="t m0 x1 h3 y44 ff3 fs1 fc1 sc0 ls1 ws1">Existen otras finalidades por la que tratamos tus datos personales: </div><div class="t m0 x2 h3 y45 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Para garantizar el cumplimiento de las condiciones de uso y la ley aplicable. </span></span></div><div class="t m0 x3 h3 y46 ff3 fs1 fc1 sc0 ls1 ws1">Esto puede incluir el desarrollo de herramientas <span class="_ _1"></span>y algoritmos que ayudan a </div><div class="t m0 x3 h3 y47 ff3 fs1 fc1 sc0 ls1 ws1">esta web a garantizar la confidencialidad de los datos personales que </div><div class="t m0 x3 h3 y48 ff3 fs1 fc1 sc0 ls1 ws1">recoge. </div><div class="t m0 x2 h3 y49 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Para apoyar y mejorar los servici<span class="_ _1"></span>os que ofrece esta web.<span class="_ _2"></span> </span></span></div><div class="t m0 x2 h3 y4a ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">También se recogen otros datos no identific<span class="_ _1"></span>ativos que se obtienen mediante </span></span></div><div class="t m0 x3 h3 y4b ff3 fs1 fc1 sc0 ls1 ws1">algunas cookies que se descargan en e<span class="_ _1"></span>l ordenador del usuario cuando </div><div class="t m0 x3 h3 y4c ff3 fs1 fc1 sc0 ls1 ws1">navega en esta web que es<span class="_ _1"></span>tán detalladas en la<span class="_ _2"></span> <span class="fc3">política de cookies.</span> </div><div class="t m0 x1 h3 y4d ff3 fs1 fc1 sc0 ls1 ws1"> </div><div class="t m0 x1 h3 y4e ff3 fs1 fc1 sc0 ls1 ws1">Salud Integral no vende, alquila ni cede datos de carácter personal que puedan </div><div class="t m0 x1 h3 y4f ff3 fs1 fc1 sc0 ls1 ws1">identificar al usuario, ni lo hará en e<span class="_ _1"></span>l futuro.<span class="_ _2"></span> </div><div class="t m0 x1 h4 y50 ff2 fs3 fc0 sc0 ls1 ws1">Principios que aplicaremos a tu información personal </div><div class="t m0 x1 h3 y51 ff3 fs1 fc1 sc0 ls1 ws1">El tratamiento de los datos personales del Usuario se some<span class="_ _1"></span>terá a los <span class="_ _2"></span>siguientes </div><div class="t m0 x1 h3 y52 ff3 fs1 fc1 sc0 ls1 ws1">principios recogidos en el artículo 5 del RGPD: </div><div class="t m0 x2 h5 y53 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff2 fs1 fc0 ls1">Principio de licitud, lealtad y transparencia<span class="ff3 fc1">: se requerirá en todo </span></span></span></div><div class="t m0 x3 h3 y54 ff3 fs1 fc1 sc0 ls1 ws1">momento el consentimiento del Usuario previa información completamente </div><div class="t m0 x3 h3 y55 ff3 fs1 fc1 sc0 ls1 ws1">transparente de los fines para los cuales se recogen los datos personales. </div><div class="t m0 x2 h5 y56 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff2 fs1 fc0 ls1">Principio de limitación de la finali<span class="_ _1"></span>dad<span class="ff3 fc1">: los<span class="_ _2"></span> datos personales serán </span></span></span></div><div class="t m0 x3 h3 y57 ff3 fs1 fc1 sc0 ls1 ws1">recogidos con fines determinados, explícitos y legítimos. </div><div class="t m0 x2 h5 y39 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff2 fs1 fc0 ls1">Principio de minimización de datos<span class="ff3 fc1">: los datos personales recogidos serán </span></span></span></div><div class="t m0 x3 h3 y3a ff3 fs1 fc1 sc0 ls1 ws1">únicamente los estrictamente neces<span class="_ _1"></span>arios<span class="_ _2"></span> en relación con los fines para los </div><div class="t m0 x3 h3 y58 ff3 fs1 fc1 sc0 ls1 ws1">que son tratados. </div><div class="t m0 x2 h5 y59 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff2 fs1 fc0 ls1">Principio de exactitud<span class="ff3 fc1">: los datos personales deben ser exactos y estar </span></span></span></div><div class="t m0 x3 h3 y5a ff3 fs1 fc1 sc0 ls1 ws1">siempre actualizados. </div><div class="t m0 x2 h5 y5b ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff2 fs1 fc0 ls1">Principio de limitación del plazo de conservación<span class="ff3 fc1">: los datos personales </span></span></span></div><div class="t m0 x3 h3 y5c ff3 fs1 fc1 sc0 ls1 ws1">solo serán mantenidos de forma que se permita la identificación del Usuario </div><div class="t m0 x3 h3 y5d ff3 fs1 fc1 sc0 ls1 ws1">durante el tiempo necesario para los fines de su <span class="_ _1"></span>tratamiento.<span class="_ _2"></span> </div></div><a class="l" href="https://www.psicoglobal.com/comun/cookies"><div class="d m1" style="border-style:none;position:absolute;left:378.270000px;bottom:450.590000px;width:102.780000px;height:15.960000px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf4" class="pf w0 h0" data-page-no="4"><div class="pc pc4 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w2 h0"><div class="t m0 x2 h5 y1f ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff2 fs1 fc0 ls1">Principio de integridad y confidencialidad<span class="ff3 fc1">: los datos personales serán </span></span></span></div><div class="t m0 x3 h3 y3f ff3 fs1 fc1 sc0 ls1 ws1">tratados de manera que se garantice su seguridad y<span class="_ _1"></span> confidencialidad.<span class="_ _2"></span> </div><div class="t m0 x2 h5 y5e ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff2 fs1 fc0 ls1">Principio de responsabilidad proactiva<span class="ff3 fc1">: el Responsable del tratamiento </span></span></span></div><div class="t m0 x3 h3 y5f ff3 fs1 fc1 sc0 ls1 ws1">será responsable de asegurar que los principios anteriores <span class="_ _1"></span>se cumplen.<span class="_ _2"></span> </div><div class="t m0 x1 h4 y60 ff2 fs3 fc0 sc0 ls1 ws1">¿Cuáles son tus derechos cuando nos facilitas tus datos? </div><div class="t m0 x1 h3 y61 ff3 fs1 fc1 sc0 ls1 ws1">Cualquier persona tiene derecho a obtener confirmación sobre si en Psicoglobal </div><div class="t m0 x1 h3 y62 ff3 fs1 fc1 sc0 ls1 ws1">estamos tratando sus datos personales. </div><div class="t m0 x1 h3 y63 ff3 fs1 fc1 sc0 ls1 ws1">Las personas interesadas tienen dere<span class="_ _1"></span>cho a:<span class="_ _2"></span> </div><div class="t m0 x2 h3 y64 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Solicitar el acceso a los datos personales rel<span class="_ _1"></span>ativos al interesado<span class="_ _2"></span> </span></span></div><div class="t m0 x2 h3 y65 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Solicitar su rectificación o supresión </span></span></div><div class="t m0 x2 h3 y66 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Solicitar la limitación de su tratamiento </span></span></div><div class="t m0 x2 h3 y67 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Oponerse al tratamiento </span></span></div><div class="t m0 x2 h3 y68 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Solicitar la portabilidad de los datos </span></span></div><div class="t m0 x1 h3 y69 ff3 fs1 fc1 sc0 ls1 ws1">Los interesados podrán acceder a sus <span class="_ _1"></span>datos personales, así como a solicitar la </div><div class="t m0 x1 h3 y6a ff3 fs1 fc1 sc0 ls1 ws1">rectificación de los datos inexactos o, en su caso, solici<span class="_ _1"></span>tar su supresión de los mismos, </div><div class="t m0 x1 h3 y6b ff3 fs1 fc1 sc0 ls1 ws1">entre otros motivos, que los datos y<span class="_ _1"></span>a no <span class="_ _2"></span>sean necesarios para los fines que fueron </div><div class="t m0 x1 h3 y6c ff3 fs1 fc1 sc0 ls1 ws1">recogidos. En determinadas circunstancias, los interesados podrán solicitar la limi<span class="_ _1"></span>tación </div><div class="t m0 x1 h3 y6d ff3 fs1 fc1 sc0 ls1 ws1">del tratamiento de sus datos, en cuyo caso únicamente serán conservados para e<span class="_ _1"></span>l </div><div class="t m0 x1 h3 y6e ff3 fs1 fc1 sc0 ls1 ws1">ejercicio o la defensa de reclamaciones. </div><div class="t m0 x1 h3 y6f ff3 fs1 fc1 sc0 ls1 ws1">En determinadas circunstancias y <span class="_ _1"></span>por motivos relacionados con su situación particular, </div><div class="t m0 x1 h3 y70 ff3 fs1 fc1 sc0 ls1 ws1">los interesados podrán oponerse al tratamiento de s<span class="_ _1"></span>us datos. Psicoglobal dejará de </div><div class="t m0 x1 h3 y71 ff3 fs1 fc1 sc0 ls1 ws1">tratar los datos, salvo por motivos legítimos <span class="_ _1"></span>imperiosos, o el ejercicio o la defensa <span class="_ _2"></span>de </div><div class="t m0 x1 h3 y72 ff3 fs1 fc1 sc0 ls1 ws1">posibles reclamaciones. Cómo interesado, tienes derecho a recibir los datos pers<span class="_ _1"></span>onales </div><div class="t m0 x1 h3 y73 ff3 fs1 fc1 sc0 ls1 ws1">que te incumban, que nos hayas facilitado y <span class="_ _1"></span>en un formato estructurado, de uso común </div><div class="t m0 x1 h3 y74 ff3 fs1 fc1 sc0 ls1 ws1">y lectura mecánica, y a transmitirlos a otro responsable del<span class="_ _1"></span> tratamiento cuando:<span class="_ _2"></span> </div><div class="t m0 x2 h3 y75 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">El tratamiento esté basado en el conse<span class="_ _1"></span>ntimiento.<span class="_ _2"></span> </span></span></div><div class="t m0 x2 h3 y76 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">Los datos hayan sido facilitados por la <span class="_ _1"></span>persona interesada.<span class="_ _2"></span> </span></span></div><div class="t m0 x2 h3 y77 ff4 fs2 fc1 sc0 ls1 ws0"><span class="ff5 ls0 ws1"> <span class="ff3 fs1 ls1">El tratamiento se efectúe por medios automatizados. </span></span></div><div class="t m0 x1 h3 y78 ff3 fs1 fc1 sc0 ls1 ws1">Al ejercer tu derecho a la portabilidad de los datos, tendrás derecho a que los datos </div><div class="t m0 x1 h3 y79 ff3 fs1 fc1 sc0 ls1 ws1">personales se transmitan directamente de responsable a responsable cuando sea </div><div class="t m0 x1 h3 y7a ff3 fs1 fc1 sc0 ls1 ws1">técnicamente posible.. </div><div class="t m0 x1 h4 y7b ff2 fs3 fc0 sc0 ls1 ws1">Legitimación para el tratamiento de tus datos </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf5" class="pf w0 h0" data-page-no="5"><div class="pc pc5 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w2 h0"><div class="t m0 x1 h3 y1f ff3 fs1 fc1 sc0 ls1 ws1">La base legal para el tratamiento de s<span class="_ _1"></span>us datos es: el consentimiento.<span class="_ _2"></span> </div><div class="t m0 x1 h3 y7c ff3 fs1 fc1 sc0 ls1 ws1">Para contactar o realizar comentarios en esta web se requiere el consentimiento con </div><div class="t m0 x1 h3 y7d ff3 fs1 fc1 sc0 ls1 ws1">esta política de privacidad. </div><div class="t m0 x1 h3 y7e ff3 fs1 fc1 sc0 ls1 ws1">La oferta prospectiva o comercial <span class="_ _1"></span>de productos y servicios está basada en el </div><div class="t m0 x1 h3 y7f ff3 fs1 fc1 sc0 ls1 ws1">consentimiento que se le solicita, sin que en ningún caso la <span class="_ _1"></span>retirada de este </div><div class="t m0 x1 h3 y80 ff3 fs1 fc1 sc0 ls1 ws1">consentimiento condicione la ejecución del contrato de suscripción. </div><div class="t m0 x1 h3 y81 ff3 fs1 fc1 sc0 ls1 ws1">También la contratación de productos y se<span class="_ _1"></span>rvicios se basa en el consentimiento que se le </div><div class="t m0 x1 h3 y82 ff3 fs1 fc1 sc0 ls1 ws1">solicita. </div><div class="t m0 x1 h4 y83 ff2 fs3 fc0 sc0 ls1 ws1">¿A qué destinatarios se comunicarán tus datos? </div><div class="t m0 x1 h3 y84 ff3 fs1 fc1 sc0 ls1 ws1">Algunas herramientas que utilizamos para gestionar tus datos son contratados <span class="ls3">por </span></div><div class="t m0 x1 h3 y85 ff3 fs1 fc1 sc0 ls1 ws1">terceros. </div><div class="t m0 x1 h3 y86 ff3 fs1 fc1 sc0 ls1 ws1">Para prestar servicios estrictamente necesarios <span class="_ _1"></span>para el desarrollo de la actividad, <span class="_ _2"></span>Salud </div><div class="t m0 x1 h3 y87 ff3 fs1 fc1 sc0 ls1 ws2">Integra<span class="ls5 ws1">l <span class="ls4">no <span class="ls1">comparte datos con prestadores de <span class="_ _1"></span>servicios  </span></span></span></div><div class="t m0 x1 h4 y88 ff2 fs3 fc0 sc0 ls1 ws1">Menores de edad </div><div class="t m0 x1 h3 y89 ff3 fs1 fc1 sc0 ls1 ws1">Como se indica en las Condiciones, los menores <span class="_ _1"></span>de edad no podrán usar <span class="_ _2"></span> <span class="_ _3"></span>Salud Integral<span class="ls2">, </span></div><div class="t m0 x1 h3 y8a ff3 fs1 fc1 sc0 ls1 ws1">por lo que deberán abstenerse asimismo de facilitar cualesquiera <span class="_ _1"></span>datos. En cualquier </div><div class="t m0 x1 h3 y8b ff3 fs1 fc1 sc0 ls1 ws1">caso Salud Integral no se responsabiliza de la veracidad y e<span class="_ _1"></span>xactitud de los datos </div><div class="t m0 x1 h3 y8c ff3 fs1 fc1 sc0 ls1 ws1">rellenados por el usuario y por tanto no puede <span class="_ _1"></span>constatar la edad de los mismos.<span class="_ _2"></span> </div><div class="t m0 x1 h4 y8d ff2 fs3 fc0 sc0 ls1 ws1">Navegación </div><div class="t m0 x1 h3 y8e ff3 fs1 fc1 sc0 ls1 ws1">Al navegar por Salud Integral se pueden recoger datos no identificables, que pueden </div><div class="t m0 x1 h3 y8f ff3 fs1 fc1 sc0 ls1 ws1">incluir, direcciones IP, ubicación geográfica (aproximadamente), un regis<span class="_ _1"></span>tro de cómo se </div><div class="t m0 x1 h3 y90 ff3 fs1 fc1 sc0 ls1 ws1">utilizan los servicios y sitios, y otros datos que no pueden ser utiliz<span class="_ _1"></span>ad<span class="_ _2"></span>os para identificar </div><div class="t m0 x1 h3 y91 ff3 fs1 fc1 sc0 ls1 ws1">al usuario. Utilizamos estos datos para administrar el sitio y recabar información </div><div class="t m0 x1 h3 y92 ff3 fs1 fc1 sc0 ls1 ws1">demográfica y estadística sobre e<span class="_ _1"></span>l conjunto<span class="_ _2"></span> de <span class="_ _1"></span>clientes.<span class="_ _2"></span> </div><div class="t m0 x1 h4 y93 ff2 fs3 fc0 sc0 ls1 ws1">Secreto y seguridad de los datos </div><div class="t m0 x1 h3 y94 ff3 fs1 fc1 sc0 ls1 ws1">Salud Integral se compromete en el uso y tratamiento de los datos incluidos personales </div><div class="t m0 x1 h3 y95 ff3 fs1 fc1 sc0 ls1 ws1">de los usuarios, respetando su confidencialidad y <span class="_ _1"></span>a utilizarlos de acuerdo con la </div><div class="t m0 x1 h3 y96 ff3 fs1 fc1 sc0 ls1 ws1">finalidad del mismo, así como a dar cumplimiento a su obligación de <span class="_ _1"></span>guardarlos y </div><div class="t m0 x1 h3 y97 ff3 fs1 fc1 sc0 ls1 ws1">adaptar todas las medidas para evitar la alteración, pérdida, tratamiento o acceso no </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf6" class="pf w0 h0" data-page-no="6"><div class="pc pc6 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w2 h0"><div class="t m0 x1 h3 y1f ff3 fs1 fc1 sc0 ls1 ws1">autorizado, de conformidad con lo estable<span class="_ _1"></span>cido<span class="_ _2"></span> en la normativa vigente de <span class="_ _1"></span>protección de </div><div class="t m0 x1 h3 y3f ff3 fs1 fc1 sc0 ls1 ws1">datos. </div><div class="t m0 x1 h3 y7d ff3 fs1 fc1 sc0 ls1 ws1">Esta web incluye un certificado SSL (protocolo https). Esto es<span class="_ _1"></span> un protocolo de seguridad </div><div class="t m0 x1 h3 y98 ff3 fs1 fc1 sc0 ls1 ws1">en el cual tus datos viajan de manera se<span class="_ _1"></span>gura, cifrada y <span class="_ _2"></span>encriptada, en la transmisión de </div><div class="t m0 x1 h3 y99 ff3 fs1 fc1 sc0 ls1 ws1">información entre un servidor y un usuario de la w<span class="_ _1"></span>eb.<span class="_ _2"></span> </div><div class="t m0 x1 h3 y80 ff3 fs1 fc1 sc0 ls1 ws1">Sin embargo, debido a que Salud Integral no puede garantizar la inexpugabilidad de </div><div class="t m0 x1 h3 y9a ff3 fs1 fc1 sc0 ls1 ws1">internet ni la ausencia total de hackers u otros que <span class="_ _1"></span>accedan de modo fraudu<span class="_ _2"></span>lento a los </div><div class="t m0 x1 h3 y45 ff3 fs1 fc1 sc0 ls1 ws1">datos personales, el Responsable del tratamiento se compromete a <span class="_ _1"></span>comunicar al </div><div class="t m0 x1 h3 y46 ff3 fs1 fc1 sc0 ls1 ws1">Usuario sin dilación indebida cuando ocurra una violación de la s<span class="_ _1"></span>eguridad de los datos </div><div class="t m0 x1 h3 y47 ff3 fs1 fc1 sc0 ls1 ws1">personales que sea probable que entrañe un alto ries<span class="_ _1"></span>go para los derechos y libertades </div><div class="t m0 x1 h3 y48 ff3 fs1 fc1 sc0 ls1 ws1">de las personas físicas. </div><div class="t m0 x1 h3 y9b ff3 fs1 fc1 sc0 ls1 ws1">Los datos personales serán tratados como confidenciale<span class="_ _1"></span>s por el Responsable del </div><div class="t m0 x1 h3 y9c ff3 fs1 fc1 sc0 ls1 ws1">tratamiento, quien se compromete a informar <span class="_ _1"></span>de y a garantizar por medio de una </div><div class="t m0 x1 h3 y9d ff3 fs1 fc1 sc0 ls1 ws1">obligación legal o contractual que dicha confidencialidad se<span class="_ _1"></span>a respetada por s<span class="_ _2"></span>us </div><div class="t m0 x1 h3 y9e ff3 fs1 fc1 sc0 ls1 ws1">empleados, asociados, y toda persona a la cual le haga accesible la información. </div><div class="t m0 x1 h4 y9f ff2 fs3 fc0 sc0 ls1 ws1">Exactitud y veracidad de los datos </div><div class="t m0 x1 h3 y2f ff3 fs1 fc1 sc0 ls1 ws1">Como usuario, eres el único responsable de la veracidad y<span class="_ _1"></span> corrección de los datos que </div><div class="t m0 x1 h3 ya0 ff3 fs1 fc1 sc0 ls1 ws1">remitas a Salud Integral, que quedará exonerado de cualquier responsabilidad al<span class="_ _1"></span> </div><div class="t m0 x1 h3 ya1 ff3 fs1 fc1 sc0 ls1 ws1">respecto. </div><div class="t m0 x1 h3 y32 ff3 fs1 fc1 sc0 ls1 ws1">Los usuarios garantizan y responden, en cualquier cas<span class="_ _1"></span>o, de la exactitud, vigencia y </div><div class="t m0 x1 h3 y33 ff3 fs1 fc1 sc0 ls1 ws1">autenticidad de los datos personales facilitados, y se comprometen a mantenerlos </div><div class="t m0 x1 h3 ya2 ff3 fs1 fc1 sc0 ls1 ws1">debidamente actualizados. El usuario acepta proporcionar información completa y </div><div class="t m0 x1 h3 ya3 ff3 fs1 fc1 sc0 ls1 ws1">correcta en los formularios de contacto, suscripción y regis<span class="_ _1"></span>tro.<span class="_ _2"></span> </div><div class="t m0 x1 h4 ya4 ff2 fs3 fc0 sc0 ls1 ws1">Enlaces a sitios web de terceros </div><div class="t m0 x1 h3 ya5 ff3 fs1 fc1 sc0 ls1 ws1">Salud Integral puede incluir hipervínculos o enlaces que <span class="_ _1"></span>permiten acceder a páginas </div><div class="t m0 x1 h3 ya6 ff3 fs1 fc1 sc0 ls1 ws1">web de terceros distintos de Salud Integral, y que por tanto no son operados por Salud </div><div class="t m0 x1 h3 ya7 ff3 fs1 fc1 sc0 ls1 ws1">Integral. Los titulares de dichos sitios web dispondrán de sus propias polític<span class="_ _1"></span>as de </div><div class="t m0 x1 h3 ya8 ff3 fs1 fc1 sc0 ls1 ws1">protección de datos, siendo ellos mismos, en cada caso, res<span class="_ _1"></span>ponsables de sus propios </div><div class="t m0 x1 h3 ya9 ff3 fs1 fc1 sc0 ls1 ws1">ficheros y de sus propias prácticas <span class="_ _1"></span>de privacid<span class="_ _2"></span><span class="ls6 ws3">ad.</span> </div><div class="t m0 x1 h4 yaa ff2 fs3 fc0 sc0 ls1 ws1">Aceptación y consentimiento </div><div class="t m0 x1 h3 yab ff3 fs1 fc1 sc0 ls1 ws1">El usuario declara haber sido informado de las condiciones <span class="_ _1"></span>sobre protección de datos </div><div class="t m0 x1 h3 yac ff3 fs1 fc1 sc0 ls1 ws1">de carácter personal, aceptando y consintiendo el <span class="_ _1"></span>tratamiento de los mismos por parte </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf7" class="pf w0 h0" data-page-no="7"><div class="pc pc7 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x0 y1 w2 h0"><div class="t m0 x1 h3 y1f ff3 fs1 fc1 sc0 ls1 ws1">de Salud Integral en la forma y para las finalidades indicadas en esta política de </div><div class="t m0 x1 h3 y3f ff3 fs1 fc1 sc0 ls1 ws1">privacidad. </div><div class="t m0 x1 h4 yad ff2 fs3 fc0 sc0 ls1 ws1">Revocabilidad </div><div class="t m0 x1 h3 y22 ff3 fs1 fc1 sc0 ls1 ws1">El consentimiento prestado, tanto para el tratamie<span class="_ _1"></span>nto como para la cesión de los datos </div><div class="t m0 x1 h3 y23 ff3 fs1 fc1 sc0 ls1 ws1">de los interesados, es revocable en cualquier momento comunicándolo a Salud In<span class="_ _2"></span>tegral<span class="ls2">. </span> </div><div class="t m0 x1 h3 y24 ff3 fs1 fc1 sc0 ls1 ws1">Podrás revocar tus datos en los términos es<span class="_ _1"></span>tablecidos en esta Política para el ejercicio </div><div class="t m0 x1 h3 y25 ff3 fs1 fc1 sc0 ls1 ws1">de los derechos ARCO. Esta revocación en ningún caso tendrá carácter retroactivo. </div><div class="t m0 x1 h3 y26 ff3 fs1 fc1 sc0 ls1 ws1">Los usuarios podrán ejercitar sus derechos de acces<span class="_ _1"></span>o, rectificación, cancel<span class="_ _2"></span>ación y </div><div class="t m0 x1 h3 y27 ff3 fs1 fc1 sc0 ls1 ws1">oposición mediante solicitud escrita, fechada y fi<span class="_ _1"></span>rmada, con indicación de su nombre, </div><div class="t m0 x1 h3 y28 ff3 fs1 fc1 sc0 ls1 ws1">apellidos, domicilio y fotocopia del INE, que habrán de dirigir a Salud Integral, c/ a </div><div class="t m0 x1 h3 yae ff3 fs1 fc1 sc0 ls1 ws1">través del correo electrónico contacto@saludintegral.com </div><div class="t m0 x1 h3 y2a ff3 fs1 fc1 sc0 ls1 ws1">De igual modo, el usuario puede cancelar el servicio de <span class="_ _1"></span>comunicaciones automatizadas </div><div class="t m0 x1 h3 y2b ff3 fs1 fc1 sc0 ls1 ws1">de Salud Integral, de forma que deje de recibir mails automáticos desde nuestra we<span class="_ _1"></span>b. </div><div class="t m0 x1 h3 yaf ff3 fs1 fc1 sc0 ls1 ws1">Para tal efecto, los E-Mails que reciba tienen un enlace de subscripción de dicha </div><div class="t m0 x1 h3 yb0 ff3 fs1 fc1 sc0 ls1 ws1">funcionalidad. </div><div class="t m0 x1 h4 yb1 ff2 fs3 fc0 sc0 ls1 ws1">Cambios en la política de privacidad </div><div class="t m0 x1 h3 yb2 ff3 fs1 fc1 sc0 ls1 ws1">Salud Integral se reserva el derecho a modificar su Polític<span class="_ _1"></span>a de Privacidad, de acuerdo a </div><div class="t m0 x1 h3 yb3 ff3 fs1 fc1 sc0 ls1 ws1">su propio criterio, o motivado por un cambio le<span class="_ _1"></span>gislativo, jurisprudencial o doctrinal de la<span class="_ _2"></span> </div><div class="t m0 x1 h3 yb4 ff3 fs1 fc1 sc0 ls1 ws1">Protección de Datos. Los cambios o actualizaciones de esta Política de Privacidad no </div><div class="t m0 x1 h3 yb5 ff3 fs1 fc1 sc0 ls1 ws1">serán notificados de forma explícita al Usuario. Se <span class="_ _1"></span>recomienda al Usuario consultar esta </div><div class="t m0 x1 h3 yb6 ff3 fs1 fc1 sc0 ls1 ws1">página de forma periódica para estar al <span class="_ _1"></span>tanto de los últimos cambios o actualizaciones.<span class="_ _2"></span> </div><div class="t m0 x1 h4 yb7 ff2 fs3 fc0 sc0 ls1 ws1">Correos comerciales </div><div class="t m0 x1 h3 yb8 ff3 fs1 fc1 sc0 ls1 ws1">Salud Integral no realiza prácticas de SPAM, por lo que no envía correos <span class="_ _1"></span>comerciales por </div><div class="t m0 x1 h3 yb9 ff3 fs1 fc1 sc0 ls1 ws1">vía electrónica a no ser que previamente <span class="_ _1"></span>hayas solicitado información de los servicios de </div><div class="t m0 x1 h3 yba ff3 fs1 fc1 sc0 ls1 ws1">la plataforma. En consecuencia, en cada uno de los formularios habidos en la web, el </div><div class="t m0 x1 h3 ybb ff3 fs1 fc1 sc0 ls1 ws1">usuario tiene la posibilidad de dar su <span class="_ _1"></span>consentimiento expreso para la finalidad que se </div><div class="t m0 x1 h3 ybc ff3 fs1 fc1 sc0 ls1 ws1">explique en la primera capa informativa de protección de datos <span class="_ _1"></span>que se mostrará debajo, </div><div class="t m0 x1 h3 ybd ff3 fs1 fc1 sc0 ls1 ws1">tal, con independencia de la información comercial puntualmente solicitada. </div><div class="t m0 x1 h3 ybe ff3 fs1 fc1 sc0 ls1 ws1">Te agradecemos el tiempo invertido en la le<span class="_ _1"></span>ctura de esta política de privacidad.<span class="_ _2"></span> </div><div class="t m0 x1 h3 ybf ff3 fs1 fc1 sc0 ls1 ws1">Esta Política de Privacidad fue actualizada el día <span class="ls6">15</span> de septiembre <span class="ls6">2023</span> para adaptarse </div><div class="t m0 x1 h3 yab ff3 fs1 fc1 sc0 ls1 ws1">al, relativo a la protección de las pers<span class="_ _1"></span>onas físicas en lo que respecta al tratamiento de </div><div class="t m0 x1 h3 yac ff3 fs1 fc1 sc0 ls1 ws1">datos personales y a la libre circulación de e<span class="_ _1"></span>stos datos<span class="_ _2"></span>. </div></div></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
